find_library(pktriggercord_libraries names pktriggercord 
    paths
    ${_oblinkdir}
    ${gnuwin32_dir}/lib
    path_suffixes indipentax
  )

find_library(
            _indi_lib_release_${_indi_component}
            names ${_indi_possible_release_names}
            hints ${_indi_root}
            path_suffixes ${_indi_lib_suffixes}
            doc "release libraries for indi"
        )

find_library(
            _indi_lib_debug_${_indi_component}
            names ${_indi_possible_debug_names}
            hints ${_indi_root}
            path_suffixes ${_indi_lib_suffixes}
            doc "debug libraries for indi"
        )

find_library(${_name}
        names ${argn}
        hints
            env gmock_root
            ${gmock_root}
        path_suffixes lib
    )

find_library(nova_libraries names nova libnova libnovad
    paths
    ${_oblinkdir}
    ${gnuwin32_dir}/lib
  )

find_library( gsl_library
  names gsl
  hints ${gsl_root_dir}/lib ${gsl_libdir}
  path_suffixes release debug
)

find_library( gsl_cblas_library
  names gslcblas cblas
  hints ${gsl_root_dir}/lib ${gsl_libdir}
  path_suffixes release debug
)

find_library( gsl_library_debug
  names gsl
  hints ${gsl_root_dir}/lib ${gsl_libdir}
  path_suffixes debug
)

find_library( gsl_cblas_library_debug
  names gslcblas cblas
  hints ${gsl_root_dir}/lib ${gsl_libdir}
  path_suffixes debug
)
